April 1st - Volume 1: I Feel Nothing
April 15th - Volume 2: I Feel Everything
April 29th - Volume 3: Everything Is Nothing

The material she provided was collected into one place and assembled into this torrent by the original uploader, Imperator42 at TPB.
The songs are high-bitrate CBR .mp3's
* Metadata adjusted by Imperator42
* She mentioned what song she sampled in each case; which Imperator42 mentioned in the .mp3's comment tag.

Each volume has a companion music video, in .mp4 format and a companion set of photos (.zip'ed .jpg's)

A description of the mixtape's theme in her own words:

&quot;In my mind, this mixtape is about identity, the ways in which I've grappled with who I am and what matters to me. For the past year I've been in this space of hyperawareness, constantly attempting to reconcile the disparate - and often contentious - aspects of my life.  The more that I think about it, the more I see myself as an outsider. There's something strangely comforting about feeling set apart, about understanding that everyone experiences alienation in one form or another.  Sometimes we're alienated from ourselves, sometimes from those we love, and sometimes just from the dude in front of us on the subway.

I made this mixtape by myself, alone in a basement. This served as the perfect setting, because when you're working on a project about your own head, it's nice to be lost in it all day.&quot;
